import React from "react";
import Aliados from "./components/aliados";
import Partner from "./components/patrocinadores";
import Teammates from "./components/compañeros";
import Villian from "./components/villanos";
import {
  BrowserRouter,

  Routes ,
  Route
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <div className="Container">
      <h1>h1</h1>
      <hr />
      <Routes>
      <Route path="/patrocinadores" element={<Partner />}>

      </Route> 
      <Route path="/aliados" element={<Aliados />}>

      </Route>
      <Route path="/compañeros" element={<Teammates/>}>

      </Route>

      <Route path="/villanos" element={<Villian/>}>

      </Route>


      </Routes>

    </div>
    </BrowserRouter>
  );
}

export default App;
